  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Upper Souris
  National Wildlife Refuge outlines Refuge accomplishments from January through April
  of 1948. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, collections and receipts, and wildfires. Resource management
  is outlined; topics include grazing, haying, fur harvesting, and timber removal.
  The public relations section of the report describes Refuge visitors and Refuge
  participation. N-R forms and photographs are attached. A summary report of the years'
  activities is included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
